import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className="app-wrapper">
      <header>
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQjzTy7SYMKcKmdqAL5w7sQ_3_7Vz8Xj2mXjkJCE2sDzg_Gy_8stw&s"/>
      </header>
        <nav>
            <div>Profile</div>
            <div>Messages</div>
            <div>Main content</div>
        </nav>
    </div>
  );
};

export default App;
